// 3. Function to show attributes in a modal:
function showAttributes(layerInfo) {
        if (!layerInfo || !layerInfo.isGovernorate) {
                return;
        }
        const features = layerInfo.layer.getLayers();
        if (features.length === 0) return;
        const props = features[0].feature.properties;
        let content = `<table class="attr-table">
            <thead>
                <tr>
                    <th>Attribute</th>
                    <th>Value</th>
                </tr>
            </thead>
            <tbody>`;
        for (let key in props) {
                content += `<tr><td>${key}</td><td>${props[key]}</td></tr>`;
        }
        content += `</tbody></table>`;
        document.getElementById("attrContent").innerHTML = content;
        document.getElementById("attrModal").style.display = "block";
}

