document.getElementById("styleForm").addEventListener("submit", function (e) {
        e.preventDefault();
        const layerId = currentEditingLayerId;
        const layerInfo = layersData[layerId];
        const newFillColor = document.getElementById("fillInput").value;
        const newOutlineColor = document.getElementById("outlineInput").value;
        const newWeight = parseFloat(document.getElementById("weightInput").value);
        const newOpacity = parseFloat(document.getElementById("opacityInput").value);
        const noFillChecked = document.getElementById("noFill").checked;
        const newFillOpacity = noFillChecked ? 0 : layerInfo.defaultStyle.fillOpacity;
        const newStyle = {
                fillColor: newFillColor,
                color: newOutlineColor,
                weight: newWeight,
                opacity: newOpacity,
                fillOpacity: newFillOpacity
        };
        layerInfo.layer.setStyle(newStyle);
        document.getElementById("styleModal").style.display = "none";
});

