let sideBySideControl = null;

document.getElementById("compareButton").addEventListener("click", function () {
        const governorate = document.getElementById("governorateSelect").value;
        const year1 = document.getElementById("yearSelectLeft").value;
        const year2 = document.getElementById("yearSelectRight").value;

        if (sideBySideControl) {
                map.removeControl(sideBySideControl);
                sideBySideControl = null;
        }

        if (!governorate || !year1 || !year2) {
                alert("Please select a governorate and both years.");
                return;
        }

        if (year1 === year2) {
                alert("Please select two different years for comparison.");
                return;
        }

        if (governorateCoords[governorate]) {
                const { center, zoom } = governorateCoords[governorate];
                map.setView(center, zoom);
        } else {
                map.setView([30.94399843969005, 30.359752277550538], 8);
        }

        map.eachLayer(function (layer) {
                if (layer instanceof L.TileLayer.WMS) {
                        map.removeLayer(layer);
                }
        });

        const leftLayer = governorateLayers[governorate][year1];
        const rightLayer = governorateLayers[governorate][year2];

        if (!leftLayer || !rightLayer) {
                alert("The selected layers are not available.");
                return;
        }

        leftLayer.addTo(map);
        rightLayer.addTo(map);

        sideBySideControl = L.control.sideBySide(leftLayer, rightLayer).addTo(map);

        const slider = document.querySelector('.leaflet-sbs-range');
        if (slider) {
                slider.addEventListener('mousedown', function () {
                        map.dragging.disable();
                });
        }
        document.addEventListener('mouseup', function () {
                map.dragging.enable();
        });
});

document.getElementById("stopButton").addEventListener("click", function () {
        if (sideBySideControl) {
                map.removeControl(sideBySideControl);
                sideBySideControl = null;
        }
});

