legend.onAdd = function (map) {
        var div = L.DomUtil.create('div', 'info legend'),
                layers = [
                        { name: "2020", layer: "ITI:2020" },
                        { name: "2010", layer: "ITI:2010" },
                        { name: "2000", layer: "ITI:2000" }
                ],
                imgBaseUrl = "http://localhost:8080/geoserver/ITI/wms?REQUEST=GetLegendGraphic&FORMAT=image/png&LAYER=";
        var html = '<h4>NDVI</h4>';
        layers.forEach(function (item) {
                // Encode spaces etc. in the layer name for URL safety
                var layerName = encodeURIComponent(item.layer);
                var url = imgBaseUrl + layerName;
                html +=
                        '<div class="legend-item">' +
                        '<img src="' + url + '" alt="Legend for ' + item.name + '">' +
                        '<span>' + item.name + '</span>' +
                        '</div>';
        });

        div.innerHTML = html;
        return div;

};

legend.addTo(map);

